<script>
    import { onMount } from "svelte";
    import {data, isReplay, stingerBool} from "./socketio.js";
    import { panelData } from "./socketio.js";
    import { resize_to_fit } from "./resizeToFit.js";
    import { minimum_size } from "./minimumSize.js";
    let time;

    onMount(() => {
        console.log("scorebug loaded");
    });

    $: {
        if ($panelData && document.getElementById("blue-team-name") && document.getElementById("red-team-name")){
			document.getElementById("blue-team-name").style.fill = $panelData.blueOverride != "" ? $panelData.blueOverride : "#fff";
			document.getElementById("red-team-name").style.fill = $panelData.orngOverride != "" ? $panelData.orngOverride : "#fff";
		}
        if(document.getElementById("outer-sbg") && ($stingerBool || $isReplay)){
          document.getElementById("outer-sbg").style.display = 'none'
        } else if(document.getElementById("outer-sbg")){
          document.getElementById("outer-sbg").style.display = 'block'
        }
        if ($panelData && document.getElementById("blue-team-name")) {
            document.getElementById("blue-team-name").textContent =
                $panelData?.blueName == "" ? $data?.teamData[0]?.name : $panelData?.blueName.toUpperCase();
            document.getElementById("red-team-name").textContent =
                $panelData?.orngName == "" ? $data?.teamData[1]?.name : $panelData?.orngName.toUpperCase();
            document.getElementById("best-of").textContent = $panelData?.series;
            setTimeout(() => {
                resize_to_fit(document.getElementById("blue-team-name"), 340);
                resize_to_fit(document.getElementById("red-team-name"), 340);
                let tempList = [
                    document.getElementById("blue-team-name"),
                    document.getElementById("red-team-name"),
                ];
                minimum_size(tempList);
            }, 250);
        }
        if (document.getElementById("red-score") && $data) {
            document.getElementById("blue-score").textContent =
                $data?.teamData[0].score;
            document.getElementById("red-score").textContent =
                $data?.teamData[1].score;
            setTimeout(() => {
                resize_to_fit(document.getElementById("blue-score"), 80);
                resize_to_fit(document.getElementById("red-score"), 80);
                let tempList = [
                    document.getElementById("blue-score"),
                    document.getElementById("red-score"),
                ];
                minimum_size(tempList);
            }, 250);
        }
        if ($data?.gameData.time_seconds != undefined) {
            time = $data?.gameData.time_seconds;

            let seconds = time - Math.trunc(time / 60) * 60;
            let minutes = Math.trunc(time / 60);
            if (seconds < 10) {
                seconds = `0${seconds}`;
            }
            time = `${minutes}:${seconds}`;
            time =
                $data?.gameData.isOT && time.split("")[0] != "+"
                    ? `+${time}`
                    : time;
            document.getElementById("time").textContent = time ?? "";
        }
        if ($panelData) {
            let fillManager = (xval, yval, color, team) => {
                for (let x = xval; x <= yval; x++) {
                    if (document.getElementById(`${team}-tick-${x}`)) {
                        document.getElementById(
                            `${team}-tick-${x}`
                        ).style.fill = color;
                    }
                }
            };
            fillManager(
                $panelData.blueScore,
                4,
                `#ffffff00`,
                "blue"
            );
            fillManager(
                $panelData.orngScore,
                4,
                `#ffffff00`,
                "red"
            );
            fillManager(
                1,
                $panelData.blueScore,
                `#ffffffff`,
                "blue"
            );
            fillManager(
                1,
                $panelData.orngScore,
                `#ffffffff`,
                "red"
            );
            //series management
            {
                let tickManager = (xval, y, opacity) => {
                    for (let x = xval; x <= y; x++) {
                        document
                            .getElementById(`red-tick-${x}`)
                            .setAttribute("opacity", opacity);

                        document
                            .getElementById(`blue-tick-${x}`)
                            .setAttribute("opacity", opacity);
                    }
                };
                if ($panelData?.series == "Best of 1") {
                    tickManager(1, 4, 0);
                } else if ($panelData.series == "Best of 3") {
                    //bo3 start
                    tickManager(1, 4, 0);
                    tickManager(1, 2, 1);
                } else if ($panelData.series == "Best of 5") {
                    //bo5 start
                    tickManager(1, 4, 0);
                    tickManager(1, 3, 1);
                } else if ($panelData.series == "Best of 7") {
                    //bo7 start
                    tickManager(1, 4, 1);
                }
            }
        }
    }
</script>

